(function(){"use strict";BX.addCustomEvent(window,"BX.Landing.Block:init",function(e){var n=e.makeRelativeSelector(".u-header");if(e.block.querySelectorAll(n).length>0){if(BX.Landing.getMode()=="view"){$.HSCore.components.HSHeader.init($(n))}}var o=e.makeRelativeSelector(".js-scroll-nav");if(e.block.querySelectorAll(o).length>0){$.HSCore.components.HSScrollNav.init($(".js-scroll-nav"),{duration:400,easing:"easeOutExpo"})}})})();